import "./style.css";
import React, { useState } from "react";
import Home from "./component/Home";
import Navbar from "./component/Navbar";
import Skills from "./component/Skills";
import Projects from "./component/Projects";
import Socials from "./component/Socials";

function App() {
  const [displayPage, setPage] = useState("home");
  return (
    <>
      <Navbar
        showHome={() => setState("home")}
        showSkills={() => setState("skills")}
        showProjects={() => setState("projects")}
        showSocials={() => setState("socials")}
      />
      {displayPage === "home" && <Home />}
      {displayPage === "skills" && <Skills />}
      {displayPage === "projects" && <Projects />}
      {displayPage === "socials" && <Socials />}
    </>
  );
}

export default App;
